import './navBar.css'
import Images from '../back-images/back';


const NavBar = () => {
    return (

        <><nav>
            <ul>
                <li><a href="">Home</a></li>
                <li><a href="">Terms and Conditions</a></li>
                <li><a href="">Privacy policy</a></li>
            </ul>
        </nav><div className='bg'></div></>

    );
};

export default NavBar;
